import React from 'react'

class FormEmprego extends React.Component{
    render(){
        return(
          <section>
            <fieldset>
               <label htmlFor="curri">
                   Resumo do Curriculo
                   <textarea name="curriculo" id="curri" cols="30" maxLength='1000' rows="10"></textarea>
               </label>
               <label htmlFor="cargo">
                   Cargo
                   <textarea name="cargo" id="cargo" cols="30" maxLength='40' rows="10"></textarea>
               </label>
               <label htmlFor="cargodes">
                   <textarea name="descricaoCargo" id="cargodes" cols="30" maxLength='500' rows="10"></textarea>
               </label>                
            </fieldset>
          </section>
        )
    }
}

export default FormEmprego;
